import React, { useState } from 'react'
import Cart from '../Cart/Cart';
import Gym from '../Gym/Gym';
import Nav from '../Nav/Nav';
import "./Home.css"

const Home = () => {

    const [cart, setCart]= useState([]);

    const addToList =(gym)=>{
      
        const newCart=[...cart, gym];
        setCart(newCart);
    }


    return (
        <div >

           <div>
            <Navbar></Navbar>
           </div>

          <div className='  '>
          <div className=''>
                    <div>
                        <Nav></Nav>
                    </div>
                     <div>
                          <Gym 
                          addToList={addToList}
                     
                           ></Gym>
                     </div>
                </div>


           <div className=''>
                    <Cart
                       cart={cart} 
                     ></Cart>
               
           </div>
          </div>


          
           


        </div>

       
          


    );
};

export default Home;
